### POST /tokens/v1

This endpoint is used to create a new token with specified name and scopes.

#### Request

- Method: POST

- Base URL: {{baseURL}}

- Path: {{publicApiUrlPath}}/tokens/v1

- Headers:

    - Content-Type: application/json

- Body:

    - tokenName (string, required): The name of the token to be created.

    - scopes (array, required): The scopes to be assigned to the token.


#### Response

The response is in JSON format and has the following schema:

``` json
{
  "type": "object",
  "properties": {
    "tokenId": {
      "type": "string"
    },
    "name": {
      "type": "string"
    },
    "userId": {
      "type": "integer"
    },
    "createdAt": {
      "type": "string"
    },
    "message": {
      "type": "string"
    },
    "token": {
      "type": "string"
    }
  }
}

 ```

- Status: 200

- Content-Type: application/json

